(234,	'25% Off Penguin Cove & Nursery Experience',	'Dubai Aquarium & Underwater Zoo is an integral part of The Dubai Mall‚Äôs diverse entertainment portfolio. Located strategically in the centre of the Mall, Dubai Aquarium is one of the largest indoor aquariums of its kind in the world at 51m long, 20m wide and 11m deep. With the capacity to hold 10 million litres of water, Dubai Aquarium illuminates the marvels of the ocean floor and showcases one of the most diverse collections of aquatic life worldwide. Dubai Aquarium has thousands of aquatic animals, representing several hundred-marine species. \r\n\r\nUnderwater Zoo, located on Level 2, offers an interactive approach to educating guests of all ages on the ecology and sustainability of marine life. The journey consists of three ecological zones: Rainforest, Rock Pool Coastline and UAE Night Creatures, where a variety of aquatic animals are featured including Crocodiles, Piranhas, Giant Spider Crabs, Otters, Water Rats, Sea Horses and Sea Jellies amongst others.\r\n\r\nT&C‚Äôs\r\nValid for up to 4 guests\r\nNot valid on public holidays\r\nPayment at admissions counter by cash or credit card\r\nValid weekends and weekdays\r\nGlass Bottom Boat Ride not available for pregnant guests and children below 3 years of age\r\nChildren under 3 years of age free of charge\r\nChildren under 16 years of age must be accompanied by an adult (16+ years old)\r\n\r\nConditions:\r\nOpening hours: 10:00 to 22:00 (Sun-Wed), last admission: 21:00. Weekends: ‚ÄúThur-Sat‚Äù 10:00 to 23:00, last admission: 22:15. Timings are subject to change. \r\nDubai Aquarium & Underwater Zoo is not responsible for lost, misplaced or stolen tickets.\r\nDubai Aquarium & Underwater Zoo may change operating hours or close temporarily due to refurbishing, capacity, inclement weather or special events, and may otherwise be discounted without notice and without liability to the owner.\r\nTicket does not entitle holder to non-complimentary services or provisi