(236,	'25% Off General Admission',	'Located on the ground floor of the mall next to The Waterfall, the Olympic-size Dubai Ice Rink has become a social hotspot, appealing to the entire spectrum of the society, both to young and old alike. Dubai Ice Rink has enhanced its range of facilities to define its credentials as the must-visit leisure destination in the city. Assuring unlimited fun for skating enthusiasts and for visitors, it offers several unmatched features for youth including Dubai Ice Rink Skating Academy (DIRSA) and a full programme of coaching from basic learn to skate to advanced figure skating.\r\n\r\nIn addition to skating sessions and training programmes, Dubai Ice Rink has enhanced its lifestyle appeal with cool D.J. nights and snow fall sessions to add to the joy for youngsters and young at heart. The coolest events venue in the city, Dubai Ice Rink also serves as an ideal setting for celebratory events or friendly get-togethers.\r\n\r\nT&Cs\r\nValid for up to 4 guests\r\nNot valid on public holidays\r\nPayment at admissions counter by cash or credit card\r\nValid weekends and weekdays\r\n\r\nConditions:\r\nOpening hours: 10:00 to 22:00 (Sun-Wed), last admission: 21:00. Weekends: ‚ÄúThu-Sat‚Äù 10:00 to 00:00. Timings are subject to change\r\nPlease arrive at least 15 minutes earlier to get ready before the session. Please wear warm and comfortable clothing suitable for exercising in thick, long socks and gloves if possible.\r\nAdditional personal protective equipment is available for purchase at the Skate Shop. \r\nThere are no refunds in whole or in part which will be allowed under any circumstances.\r\nDubai Ice Rink reserves the right to reschedule sessions and session‚Äôs timings without prior notice.\r\nValid voucher must be presented.\r\nIf you have any questions, please send an email to dubaiicerink@emaar.ae or call us at +971 4 4485111.\r\nNew safety measures, https://www.dubaiicerink.com/en/covid19/index.aspx',	7,	'dkaOaiVJfYFqhMYtBbOHnitTL