(265,	'35% Off Treatments',	'Experience world-class dental care with Dubai‚Äôs most premium dental specialist. Smile Bay Dental Cafe, a coffee shop inspired dental clinic is a first of its kind in the Middle East. Situated in the heart of Business Bay the clinic showcases panoramic views along the Dubai canal. Home to an experienced team of professionals, providing patients with state of the art dentistry technology. Specializing in Cosmetic, Microscopic, Restorative & Oral Surgery Dentistry. \r\n\r\nSmile Bay Dental Cafe are offering 35% off ALL treatments & procedures to TDG members. Discount not valid in conjunction with any other offers or promotions.',	8,	'nm6CyFd9YXtnHdfiOA6MorsjJDkchUAN1o71N9Ug.png',	180,	'Present ID to redeem discount',	'2021-04-13 12:41:48',	1,	'2021-04-13 12:41:48',	'2021-04-13 12:41:48'),
(268,	'15% Off Classes',	'The Digital Yoga Studio is an online Yoga and Meditation platform, offering guided and interactive live group & private classes via Zoom. They believe that Yoga is for everyBODY and can be practiced anywhere. Their classes suit beginners but all levels are welcome to join. They offer Hatha Flow, Yin Yoga, Prenatal Yoga & Meditation classes.\r\n\r\nThe Digital Yoga Studio are offering 15% off on all private one-one online classes, and the group 10-class pass to all TDG members.',	14,	'WWNIh8ZbPZypNuYyDStrT51uEvteKHf5eZOniwer.jpeg',	182,	'Present ID to redeem discount',	'2021-04-20 06:34:41',	1,	'2021-04-20 06:34:41',	'2021-04-20 06:34:41'),
(270,	'20% Off Food',	'This modern and stylish cocktail bar is where you can choose to relax and unwind indoors or outdoors with some masterly mixed cocktail, a fine glass of wine or some light snacks. \r\n\r\n Healey‚Äôs Bar & Terrace are offering 20% off all food to TDG members.',	5,	'DrtoA4vo7nlrCe3m0WmP7SYlwj4uk9k3SDxY5kiq.jpeg',	184,	'Present ID to redeem discount',	'2021-04-20 09:10:00',	1,	'2021-04-20 09:10:00',	'2021-04-20 09:10:00'),
(271,	'Free Pool Access',	'Located on the 11th floor the unique, The Leisure Deck is open to the elements on three sides and features a large infinity style swimming pool & Jacuzzi with a panoramic pool bar to sit back, cool off and enjoy a refreshing beverage or a light snack.\r\n\r\nThe Leisure Deck are offering a Lunch & Swim deal with free pool access when you purchase anything from the lunch menu to all TDG members.',	15,	'cAlkQYRBORbGvgm4ZkAyJhjwdnV6Vljc1kduHY9D.jpeg',	185,	'Present ID to redeem discount',	'2021-04-20 09:11:47',	1,	'2021-04-20 09:11:47',	'2021-04-20 09:11:47'),
