(277,	'50% Off Cut and Blowdrys',	'Tito & Tuthill pride themselves on ensuring that the client always comes first, believing that a thorough & full consultations are the foundations of success. The salon pride themselves on having a team with genuine passion to get the best results.Tito & Tuthill create a unique and personally tailored experience for each and every client. \r\n\r\nTito & Tuthill are offering 50% off on blowdrys/cut and blowdrys with every ombre, balayage or highlights to all TDG members. Valid every day!',	2,	'GQXgJXFm2nhtCcVBo7jkGgxujKqy2zHOp6cYhqGf.jpeg',	24,	'Present ID to redeem discount',	'2021-04-22 10:37:25',	1,	'2021-04-22 10:37:25',	'2021-04-22 10:37:25'),
