(279,	'Free Hair Extension Fitting',	'Tito & Tuthill pride themselves on ensuring that the client always comes first, believing that a thorough & full consultations are the foundations of success. The salon pride themselves on having a team with genuine passion to get the best results. Tito & Tuthill create a unique and personally tailored experience for each and every client. \r\n\r\nTito & Tuthill are offering free fittings on all new hair extensions to TDG members.',	2,	'c0qMjnexwJcCkCSRYbQ0QyBbvR00BA3o1U490wUb.jpeg',	24,	'Present ID to redeem discount',	'2021-04-22 10:42:33',	1,	'2021-04-22 10:42:33',	'2021-04-22 10:42:33'),
(280,	'Buy 4 Get 1 Free on Salon Treatments',	'Tito & Tuthill pride themselves on ensuring that the client always comes first, believing that a thorough & full consultations are the foundations of success. The salon pride themselves on having a team with genuine passion to get the best results.Tito & Tuthill create a unique and personally tailored experience for each and every client. \r\n\r\nTito & Tuthill are offering buy 4 and get 1 free on any in salon treat to TDG members.',	2,	'gDam7VUt3m4Nw1DnHSvcNr5j1XhGig99AYd4NoyE.jpeg',	24,	'Present ID to redeem discount',	'2021-04-22 11:59:23',	1,	'2021-04-22 11:59:23',	'2021-04-22 11:59:23'),
(281,	'900 AED Brazilian Blowout',	'At Chill Salon, they love to do seamless Ombre and highlighting techniques as well as the creative challenge of high-fashion colouring. They‚Äôve found that a careful client consultation and absolute precision really sets Chill Salon apart. The Chill Salon Company has been styling and creating for 10 years and works with talented professional hairstylists with years of experiences, strong resumes and references. \r\n\r\nChill Salon are offering a Brazilian Blowout for 900 AED to all TDG members.',	2,	'jVxnla0WxIDpdxSA8hekeKSuhwCn8VsBG8IvvrlP.jpeg',	148,	'Present ID to redeem discount',	'2021-04-22 12:02:20',	1,	'2021-04-22 12:02:20',	'2021-04-22 12:02:20'),
(282,	'25% Off Services',	'Tall Photographer is a Dubai based professional photographer with more than decade of experience in portrait, commercial and corporate photography. \r\n\r\nTall Photographer are offering 25% off all their photo and video services to all TDG members.',	13,	'ANNJXan9lJ8WPBMtqurYP2V2rWeDGvnsgwJNSFg3.jpeg',	187,	'Present ID to redeem discount',	'2021-04-25 05:46:25',	1,	'2021-04-25 05:46:25',	'2021-04-27 08:07:30'),
(283,	'20% Off Spa Treatments',	'The award-winning and all-natural Jiva Spa is a boutique-style spa oasis located just above the gym and the pool deck at Taj Dubai, offering a unique range of wellness treatments and rituals that blend some classic Indian healing techniques with the finest natural ingredients and the iconic Taj service. All products used at Jiva Spa are natural and uniquely developed from Indian herbs, essential oils and special ingredients.\r\n\r\nJiva Spa features four intimate treatment rooms including a luxury couple‚Äôs treatment suite, sauna and steam rooms, dedicated male and female lockers and direct access to an outdoor swimming pool with a spacious deck, pool bar and a separate shallow pool for little guests.\r\n\r\nJiva Spa are offering 20% off their spa treatments to all TDG members. Discount is not available during black-out dates (National holidays, Eid, Festive, etc).',	15,	'3EmrckcoNArA44MRVYY9AfQBCX7r6r2FA4CgFLpE.jpeg',	188,	'Present ID to redeem',	'2021-04-26 07:07:43',	1,	'2021-04-26 07:07:43',	'2021-04-26 09:06:28'),
(284,	'30% Off Tanning',	'PLUSH TAN are proud of their long standing reputation as Dubai‚Äôs leading indoor tanning and spray tan salon. For over 20 years, the owners and staff of PLUSH TAN have worked hard to educate themselves and their clients on the latest tanning trends and industry so all of their clients can feel confident in knowing they will have a safe and enjoyable tanning and spray tan experience. PLUSH TAN is committed to providing exceptional service at a reasonable price. They invite you to see yourself and what sets them apart from all other tanning and spray tan salons. Please stop by for a short tour, pick up a pricing guide and make an intelligent decision.\r\n\r\nVisit them in DIFC, Motor City or Barsha Heights.\r\n\r\nPLUSH TAN are offering 30% off tanning packages of 5/10/20 sessions to all TDG members.',	2,	'C7TL9uXPtSRGflmQBV6x4Uf050DlCfcdKPmztFW5.jpeg',	189,	'Present ID to redeem discount',	'2021-04-27 06:47:44',	1,	'2021-04-27 06:47:44',	'2021-04-29 07:12:58'),
(285,	'20% Off Eyelashes and Brows',	'PLUSH TAN are proud of their long standing reputation as Dubai‚Äôs leading indoor tanning and spray tan salon. For over 20 years, the owners and staff of PLUSH TAN have worked hard to educate themselves and their clients on the latest tanning trends and industry so all of their clients can feel confident in knowing they will have a safe and enjoyable tanning and spray tan experience. PLUSH TAN is committed to providing exceptional service at a reasonable price. They invite you to see yourself and what sets them apart from all other tanning and spray tan salons. Please stop by for a short tour, pick up a pricing guide and make an intelligent decision.\r\n\r\n\r\nPLUSH TAN are offering 20% off on eyelashes and brows to all TDG members. Visit them in their DIFC branch to redeem your discount.',	2,	'OtHMYHsRZmQqQPKNVeV4BhxRIh9HyDljbF6gv0rx.png',	189,	'Present ID to redeem discount',	'2021-04-27 06:49:25',	1,	'2021-04-27 06:49:25',	'2021-04-28 12:25:09'),
(286,	'Up To 35% Off Productions',	'First and Ten Productions is a UAE based production house, bringing brands to life and tell their stories. They specialize in producing engaging video, photo and animated content to support corporations, SMEs and individuals by creating tailored content plans, filming and photographing high-quality footage and delivering polished digital assets for any needs.\r\n\r\nFirst and Ten Productions are offering up to 35% off on all productions to TDG members.',	13,	'wvrdwJ9xJPQLgnS4GA6nYw63ZDCTWFkhoomGnoeq.png',	190,	'Present ID to redeem discount',	'2021-05-03 06:36:13',	1,	'2021-05-03 06:36:13',	'2021-05-03 06:41:14'),
(287,	'Zbooni & TDG Partnership - AD',	'TDG have partnered with the amazing Zbooni to help all our members with businesses grow and manage their payments easily!\r\n\r\nThe Zbooni app gives businesses free tools to start, run and grow online. Get setup in minutes and have the instant ability to accept payments through payment links, create automated mobile invoices, build an e-store and more!\r\n\r\nWhether you‚Äôre a personal trainer, a lawyer, a fashion consultant, selling products or services online, Zbooni can help you get paid digitally in-person and online from around the world. Start today with transparent fees, assured security infrastructure, and without any programming skills required whatsoever.\r\n\r\nP.s. They\'ll be extra nice to you if you mention you are from TDG!',	13,	'asZGWAdwZgse3kuh7GjshHpMY0NQDMPstX8MQkBf.png',	191,	'Email to find out more!',	'2021-05-03 12:58:11',	2,	'2021-05-03 12:58:11',	'2021-05-04 05:23:17'),
(288,	'150 AED Pool Access Redeemable on F&B',	'Discover Hotel Indigo Dubai Downtown, the boutique design-led property offering stylish & pet-friendly rooms and suites, curated through art and design in every corner. Think good times, good vibes, and a cheeky swim with their All-Day Pool Access* at all outlets.\r\n\r\nEnjoy this adult day pass with access to gymnasium, yoga studio, and steam room. What are you waiting for? Book now!\r\n\r\nHotel Indigo Downtown are offering pool access for 150 AED which is fully redeemable on food and beverages (except shisha and alcohol).\r\n\r\n*T&Cs apply.',	15,	'agQ2SzhjVngDhWQkfkX8yJa5HH5F7dMGlrhVhqgA.png',	192,	'Present ID to redeem discount',	'2021-05-06 05:46:49',	1,	'2021-05-06 05:46:49',	'2021-05-06 07:23:07'),
(290,	'20% Off Labour',	'A2B Garage is a British owned and managed workshop located in Al Quoz industrial area of Dubai and provides a full range of maintenance and repair services for all types of vehicles. They specialize in Land Rover & Jaguar repairs and servicing offering customers a cost effective alternative to the main dealer. They are also experienced in all common car brands!\r\n\r\nA2B are offering all TDG members 20% off the labour cost. Feel free to WhatsApp for more information - 0585257066',	13,	'kZgjUOjkfFkvgDjBmWtMW5ewZwnmECqIN1gklGFs.png',	193,	'Present ID to redeem discount',	'2021-05-06 07:30:21',	2,	'2021-05-06 07:30:21',	'2021-05-10 06:28:26'),
(291,	'15% Off Purchases',	'ALLine stands for ALL in one LINE. They are an E-commerce store selling various kinds of Apparel, both brand new and pre-loved. They offer¬†100% Natural Skin Care Brand and Health & Wellness Products.\r\n\r\nALLine are offering 15% off on purchases to TDG members.',	3,	'OmLcxw9PYSUTSZ9jstQiDB4nmpLbsHnppd2lLN45.jpeg',	195,	'Present ID to redeem discount',	'2021-05-10 06:26:09',	1,	'2021-05-10 06:26:09',	'2021-05-10 06:28:44'),
(292,	'15% Off Purchases',	'UNUSUAL offers a unique selection of 18K Gold plated and 925 Sterling Silver, handmade jewellery from all over the globe. Their collections are the perfect combination of simplicity and statement, that match your everyday looks. Whether you are looking for an item for a night out or something to enhance your daily look. We got you covered. \r\n\r\nUNUSUAL are offering 15% off everything to all TDG members.',	3,	'vC3Eg1EYwMkiPg8zuXdtwcWgAgdnRXJ5EDFoNHxv.jpeg',	196,	'Use code TDG at checkout',	'2021-05-10 08:40:49',	1,	'2021-05-10 08:40:49',	'2021-05-11 05:38:48'),
(294,	'Buy 1 Get 1 Free on Breakfast & Swim',	'Located on the 11th floor the unique, The Leisure Deck is open to the elements on three sides and features a large infinity style swimming pool & Jacuzzi with a panoramic pool bar to sit back, cool off and enjoy a refreshing beverage or a light snack.\r\n\r\nBreakfast & Swim includes a full Irish Breakfast Buffet at The Cavendish Restaurant with free access to the Leisure Deck and a fruit selection for 180 AED.\r\n\r\nThe Leisure Deck are offering buy 1 get 1 free to all TDG members. Valid on weekends only.\r\n\r\n7am ‚Äì 11am Breakfast\r\n9am ‚Äì 1pm Leisure Deck',	15,	'Us0z18iw37vfjtUYK3Bvu2z7JcYu3RrpgyIKhIEu.jpeg',	185,	'Present ID to redeem discount',	'2021-05-18 07:09:04',	1,	'2021-05-18 07:09:04',	'2021-05-18 07:09:04');
